import React from 'react';
import Logo from './logoHackaton.png'
import './NB.css'

export default function NB() {
    return (
        <div className = "NavBar">
            <div className = "box">
                <img className = "logo" src={Logo} />
            </div>
            <div className = "contact">
                <button className = "btn"></button>
            </div>
        </div>
    );
}
